import React from 'react';
import logo from './logo.svg';
import './App.css';


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {testResponse: ''}
  }

  callServerTest() {
    fetch('https://localhost:9000/test')
    .then(res => res.text())
    .then(res => this.setState({testResponse : res}))
  }

  componentWillMount() {
    this.callServerTest()
  }

